Sweetheart's most playful series continues with a new bunch of friends ready to reveal their deepest secrets and desires. Chastity Lynn admits a lesbian crush on adorable Annabelle Lee, while Avy Scott gets dared to kiss androgynous beauty Drew De Veaux. Beautiful Samantha learns that she's Zoe's ideal woman, and Annabelle recalls a lesbian romp with Australian beauty Taliah. Starring Samantha Ryan, Zoe Voss, Drew Deveaux, Avy Scott, Annabelle Lee, Chastity Lynn and Talia Mac. Written and directed by Nica Noelle.
